import './App.css';
import {BrowserRouter as Router, Route} from 'react-router-dom';
import Join from './component/Join/Join';


function App() {


  return (
    <div className="App">
      <Router>
        <Routes>
          <Route exact path="/chat" element={<Join/>} />
          <Route path='/' />
        </Routes>


      </Router>

    </div>
  );
}

export default App;
